import styled from "styled-components";

const SignIconBlock = styled.div`
  display: flex;
  justify-content: center;
  align-items: center;
  font-size: 2em;
  border: 1px solid black;
  border-radius: 4px;
  width: 1.2em;
  height: 1.2em;
`;

export default SignIconBlock;
